import React from 'react'
import products from "../Product"

function Homescreen() {
  return (
    <div id='Homescreen'>
        <div className='row'>
        {products.map((item)=>{
            return(
                <div className='col-md-3 m-5'>
                    <h5>{item.name}</h5>
                    <img src="" alt="" />
                </div>
            )
        })}
        </div>
        
    </div>
  )
}

export default Homescreen
